import { ProductPage } from './components/ProductPage/ProductPage';


function App() {
  return (
    <Router>
      <div>

        <Link to="/">SHOP</Link>
        <Link to="/">FAVOTITE</Link>
        <Link to="/">SHOP</Link>



        <Header />
        <Menu />
        <ContainerMaxWidth />
        <ProductPage />
      </div>
    </Router>
  );
}

export default App;
